class Solution(object):
    def longestDupSubstring_mle(self, S):
        # Memory limit exceeded
        """
        :type S: str
        :rtype: str
        """
        ch_to_hash = {ch: ord(ch)-ord('a') for ch in 'abcdefghijklmnopqrstuvwxyz'}
        shift = 5  # 2^5 = 32

        def search_dup_substr(substr_len):
            seen = set()
            h = 0
            mask = (1<<substr_len*shift) - 1
            # print bin(mask)
            # assert len(bin(mask))-2 == substr_len*shift, '%s, %s' % (len(bin(mask)), substr_len*shift)

            for begin in range(0, len(S)-substr_len+1):
                if begin == 0:
                    for i in range(substr_len):
                        h <<= shift
                        h += ch_to_hash[S[i]]
                    seen.add(h)
                else:
                    h <<= shift
                    h &= mask
                    # h -= ch_to_hash[S[begin-1]] << (substr_len*shift)
                    h += ch_to_hash[S[begin+substr_len-1]]
                    if h in seen:
                        return S[begin:begin+substr_len]
                    seen.add(h)

            return ''

        low = 1
        high = len(S)
        dup_substr = ''

        while low <= high:
            middle_len = (low+high) / 2
            substr = search_dup_substr(middle_len)
            if substr:
               dup_substr = substr
               low = middle_len + 1
            else:
                high = middle_len - 1

        return dup_substr

    def longestDupSubstring(self, S):
        """
        :type S: str
        :rtype: str
        """
        ch_to_hash = {ch: ord(ch)-ord('a') for ch in 'abcdefghijklmnopqrstuvwxyz'}
        factor = 26
        modulus = 2**32

        def search_dup_substr(substr_len):
            seen = set()
            h = 0
            shift = pow(factor, substr_len, modulus)

            for begin in range(0, len(S)-substr_len+1):
                if begin == 0:
                    for i in range(substr_len):
                        h = (h * factor + ch_to_hash[S[i]]) % modulus
                    seen.add(h)
                else:
                    h = (h * factor - ch_to_hash[S[begin-1]] * shift + ch_to_hash[S[begin+substr_len-1]]) % modulus
                    if h in seen:
                        return S[begin:begin+substr_len]
                    seen.add(h)

            return ''

        low = 1
        high = len(S)
        dup_substr = ''

        while low <= high:
            middle_len = (low+high) / 2
            substr = search_dup_substr(middle_len)
            if substr:
               dup_substr = substr
               low = middle_len + 1
            else:
                high = middle_len - 1

        return dup_substr


